/* import logo from './logo.svg'; */
import './App.css';
import DaisyNavBar from './components/DaisyNavBar';
import ItemDetailCointeiner from './components/Shop/ItemDetailContain';
import ShopContainer from './components/Shop/ShopContainer';
import { BrowserRouter, BrowserRouter as Router, Route, Routes } from "react-router-dom";
import ShopDetailItems from './components/Shop/ShopDetailItems';
import Carrousel from './components/Shop/Carrousel';


function App() {
  return (
      <div className="App">
        <BrowserRouter>
            <DaisyNavBar/>
            <Carrousel />
            <Routes>
                <Route path="/" element={<ShopContainer titulo={'Nuestros Productos'}/>}/>
                <Route path="/category/:productoid" element={<ShopContainer titulo={'Producto'}/>}/>
                <Route path="/productos/:itemid" element={<ShopDetailItems />}/>
            </Routes>
        </BrowserRouter>
      </div>

  );
}

export default App;
